import React from "react";

function Home(){
    return (

        <div style={{ textAlign: 'center',width:'', height: '100vh', display: 'flex', flexDirection: 'column' }}>
        <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '10px', backgroundColor: '#f0f0f0' }}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img src="../image/logo192.png" alt="logo" style={{ width: '30px', height: '30px', marginRight: '10px', marginLeft:'90px' }} />
          <h1 style={{ margin: 0 }}>Task</h1> 
          
        </div>
        
        <div>
          <button style={{ fontSize: '16px', padding: '10px 20px' ,backgroundColor: '#f2e233' }} >New Task</button>
          
          <button style={{ fontSize: '16px', padding: '10px 20px', marginLeft: '10px' , backgroundColor: '#f2e233' }} >Refresh</button>
          
          <input 
          type="text" 
          placeholder="Search tasks..." 
          style={{ textAlign: 'center', marginBottom: '10px', width: '45%', fontSize: '16px', padding: '10px', marginTop:'10px' }}
        />

        </div>
        
      </nav>
      </div>
      
    )
}

export default Home;
